import TaskItem from './TaskItem';

const TaskList = (props) => {
  const tasksList = props.tasks.map((todo) => todo.data);

  return (
    <div>
      {tasksList.map((task) => (
        <TaskItem todo={task} />
      ))}
    </div>
  );
};

export default TaskList;
